import React from 'react'

const SearchHistory = (props) => {

    const history = props.searchTerms.map((item, index) =>
        <li key={index}>{item}</li>
    )
    const style = {
        listDecoration: ''
    }
    return (
        <div style={style}>
        Search History:
        { history }
        </div>

    )
}

export default SearchHistory
